"use strict";(self.webpackChunkq10viking_github_io=self.webpackChunkq10viking_github_io||[]).push([[54448],{58612:(p,e,t)=>{t.r(e),t.d(e,{data:()=>a});const a={key:"v-2c5b1f12",path:"/aboutme/202206.html",title:"",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[],filePathRelative:"aboutme/202206.md"}},91870:(p,e,t)=>{t.r(e),t.d(e,{default:()=>n});const a=(0,t(20641).Fv)("<p>2022-06-01</p><p>手写aop功能。看完Spring 事务的课程。开始画图分析</p><hr><p>2022-06-03</p><p>这两天一直在分析Spring事务以及传播机制的源码，终于搞定了。</p><hr><p>2022-06-05</p><p>这两天一直在分析seata的源码课。AT的2PC两阶段提交。看了一下时间，不知不觉已经是六月六号了。估计明天一天就在分析seata 两阶段提交了。</p><p>今天晚上，偶然看见朋友圈，曾经狼人杀处CP的对象，官宣了他的男友。感觉自己很不舒服。自己那段时间，牺牲时间，投入感情，现在颗粒无收，耽误找工作的时间，内心深处很是对不起自己爸爸和妈妈。还是自己最亲的人疼自己。以后尽量多关心自己的亲人。因为这个世界上除了亲人，没有会在乎你的感受。爸爸妈妈我爱你。</p><p>晚上把博客搞了一搞。将部分图片迁移显示出来了</p><hr><p>2022-06-07</p><p>今天上午吃了隔夜饭，天气热，米饭都发臭了，搞得闹肚子，整个人状态都不好了。睡到了下午几点才起来。晚上的时候整理了RocketMQ的发送消息的几种模型。还是通过实践才能理解这些模型。不然老是听老师讲还是流于表面。</p><p>刷朋友圈的时候发现叶子总是在晒她的爱情。我把她给屏蔽了。呵呵呵。今天收获了一句话：高明的猎人往往以猎物的姿态出现。</p><hr><p>2022-06-09</p><p>现在稍微有点迷茫，框架源码，中间件使用学习，项目学习，一团揉在一起，不知道该从哪里下手学习了。出现这种情况的原因是最近看楼兰老师的课，感觉都太偏理论化了，没有代码层面的落地，心底很不踏实。</p><p>我还是先打算把，seata源码分析完。</p><p>今天分析seata,走到了openfeign,DataSouceProxy。解决了之前DataSource,DataSourceProxy为何只创建一个bean.以及ConnectionProxy之间的问题。晚上复习了一下Ribbon和OpenFeign的源码知识。将之前的Nacos的服务发现，联系起来了。明天准备先研究一下openfeign的源码，看看是怎么和seataFeignClient结合起来的。</p><hr><p>2022-06-10</p><p>今天复习了一下sentinel的使用课程，下午的时候刷了一下抖音发现一条新闻唐山烧烤打女人的新闻，看的我上头，整个人情绪爆炸，然后引发了我对原生家庭的愤怒，哎，真是多磨。晚上的时候看了一下RocketMQ的源码直播课。然后弟弟发信息给我，让我帮伯爷写一份农村五保户的申请书。就这样了。</p><hr><p>2022-06-13</p><p>最近这几天一直跟妈妈怄气，不想学习。前两天都是饿了，去吃小面大王（现在疫情减轻，可以堂食了），发现真是不太合算，一碗20块钱，还不如自己煮。所以今天上午去超市买了很多食物，因为发现自己总是饥饿。晚上的时候，静下心来仔细分析RocketMQ的源码，现在分析完了，NameSrv启动，Broker启动，以及注册，Producer发消息。目前找到了Broker端写消息，落盘的代码，明天再仔细分析一下。对了昨晚，看了一下水浒传，心情好多了。这些粗蛮的大汉真是蛮过瘾的。</p><p>2022-06-16</p><p>这几天走的有点乱，又学习golang,又搞前端的vue,又学习Java，感觉精力被分散了。现在还是决定主流时间搞java，抽一点点时间学习其他的知识。</p>",27),r={},n=(0,t(66262).A)(r,[["render",function(p,e){return a}]])},66262:(p,e)=>{e.A=(p,e)=>{const t=p.__vccOpts||p;for(const[p,a]of e)t[p]=a;return t}}}]);